    /**
    /**
     * {@inheritDoc}
     */
    public function load(ObjectManager $manager)
    {
        foreach ($this->getSales() as $a) {
            $sale = new Sale();
            foreach($a as $method => $value) {
                if ($method === 'products') {
                    $value = explode(', ', $value);
                    foreach($value as $pid) {
                        /** @var $product \Lev\CRMBundle\Entity\Product */
                        $product = $this->getReference('product' . $pid);
                        $saleProduct = new SaleProduct;
                        $saleProduct
                            ->setSale($sale)
                            ->setProduct($product)
                            ->setQuantity($this->qty[array_rand($this->qty)])
                            ->setUnitPrice($product->getCostAmount());
                        $manager->persist($saleProduct);
                    }
                } else {
                    if (!is_string($method)) {
                        throw new \Exception('NOT STRING METHOD NAME' . print_r($method, true));
                    }
                    $sale->$method($value);
                }
            }
            /**
             * @var $appointment \Lev\CRMBundle\Entity\Appointment
             */
            $appointment = $this->getRandomAppointment();
            $sale
                ->setOffice($appointment->getOffice())
                ->setAppointment($appointment)
                ->setCustomer($appointment->getCustomer())
            ;
            $manager->persist($sale);
            $manager->flush();
            $this->addReference('sale' . (string) $sale->getId(), $sale);
        }
    }

